import './App.css';
import gptLogo from './assets/chatgpt.svg';
import addBtn from './assets/add-30.png';
import msgIcon from './assets/message.svg';
import home from './assets/home.svg';
import saved from './assets/bookmark.svg';
import rocket from './assets/rocket.svg';
import sendBtn from './assets/send.svg';
import userIcon from './assets/user-icon.png';
import gptImgLogo from './assets/chatgptLogo.svg';
import { sendMsgToOpenAI } from './openai';
import { useState } from 'react';

function App() {
     const [input, setInput] = useState("");
     const [messages, setMessages ] = useState([
         {
          text: "This is just clone of the chatGPT using react html css and OpenAPI",
          isBot: true,
         }
    ]);


     const handleSend = async () => {
         const res = await sendMsgToOpenAI(input);
         setMessages([
          ...messages,
          { text: input, isBot: false},
          {text : res, isBot: true}
        ]);
     }


  return (
    <div className="App">
      <div className="sideBar">
        <div className="upperSide">
            <div className="upperSideTop"><img src={gptLogo} alt="Logo" className="logo" /><span className="brand">ChatGPT</span></div>
            <button className="midBtn"><img src={addBtn} alt="new chat" className="addBtn" />New Chat</button>
            <div className="upperSideBottom">
              <button className="query"><img src={msgIcon} alt="Query" />What is Programming ?</button>
              <button className="query"><img src={msgIcon} alt="Query" />How to use an API ?</button>
            </div>
        </div>
        <div className="lowerSide">
            <div className="listItems"><img src={home} alt="Home" className="listItemsImg" />Home</div>
            <div className="listItems"><img src={saved} alt="Saved" className="listItemsImg" />Saved</div>
            <div className="listItems"><img src={rocket} alt="Upgrade" className="listItemsImg" />Upgrade to Pro</div>
        </div>
      </div>
      <div className="main">
        <div className="chats">
         <div className="chat">
          <img className='chatImg' src={userIcon} alt="" /><p className="txt">My name is ranjith I am from long beach california.</p>
         </div>
         <div className="chat bot">
          <img className='chatImg' src={gptImgLogo} alt="" /><p className="txt">Lorem ipsum dolor sit amet consectetur adipisicing elit. Inventore cum exercitationem obcaecati adipisci perspiciatis odio quas reiciendis natus minima et nesciunt quo id sequi nemo tenetur, quis voluptate quod aspernatur eaque dolorem. Eaque vitae sequi ipsa nostrum ipsam quo enim facere praesentium! Quaerat necessitatibus corrupti libero. Accusamus reprehenderit odit enim libero minus neque expedita nam quia natus nisi, magnam explicabo ipsum reiciendis non porro repudiandae exercitationem. Harum repellat soluta dolor fugiat, velit laboriosam maxime, earum odit alias iste libero. Repudiandae fugiat praesentium est nesciunt. Commodi exercitationem omnis optio eius, adipisci debitis. Amet minus qui maxime commodi ipsam doloremque alias iusto?</p>
         </div>
        </div>
        <div className="chatFooter">
          <div className="inp">
            <input type="text" placeholder='Send a message' value={input} onChange={(e)=>{setInput(e.target.value)}}/><button className="send" onClick={handleSend}><img src={sendBtn} alt="Send" /></button>
          </div>
          <p> This is just clone of the chatGPT using react html css and OpenAPI</p>
          </div>
      </div>
    </div>
  );
}

export default App;
